import { Link } from 'react-router-dom'
import styled from 'styled-components'



const Header = styled.header`
  display: flex;
  justify-content: center;
`


const Red = styled.section`
  width: 166.6666666666667px;
  height: 27px;
  font-size: 0.9em;
  text-align: center;
  background:#e20816;
`

const Orange = styled.section`
  width: 166.6666666666667px;
  height: 27px;
  font-size: 0.9em;
  text-align: center;
  background:#fa6916;  
`

const Yellow = styled.section`
  width: 166.6666666666667px;
  height: 27px;
  font-size: 0.9em;
  text-align: center;
  background:#feb300; 
`

const Green = styled.section`
  width: 166.6666666666667px;
  height: 27px;
  font-size: 0.9em;
  text-align: center;
  background:#7fa01d;
`

const Blue = styled.section`
  width: 166.6666666666667px;  
  height: 27px;
  font-size: 0.9em;
  text-align: center;
  background:#0084d7; 
`

const Purple = styled.section`
  width: 166.6666666666667px;  
  height: 27px;
  font-size: 0.9em;
  text-align: center;
  background:#833074;
`

const Styled = styled(Link)`
  font-family: sans-serif;
  font-size: 1.25rem;
  color: #000;
  text-decoration: none;
`
